import React from "react";
import { NavbarWrap } from "../../styles/components/Dashboard/NavbarStyle";
import {
  AiOutlineMenu,
  AiFillHome,
  AiTwotoneFire,
  AiTwotoneSetting,
} from "react-icons/ai";
import { MdLibraryBooks } from "react-icons/md";

export default function Navbar() {
  return (
    <NavbarWrap>
      <div className="iconReactNav">
        <AiOutlineMenu />
      </div>
      <div className="iconReact">
        <AiFillHome />
      </div>
      <div className="iconReact">
        <AiTwotoneFire />
      </div>
      <div className="iconReact">
        <MdLibraryBooks />
      </div>
      <div className="iconReact">
        <AiTwotoneSetting />
      </div>
    </NavbarWrap>
  );
}
